import React, {useState} from "react";
import { Container, FormControl, InputLabel, Select, MenuItem } from "@mui/material";

const AddPhrase = () => {
      console.log("Ad dPhrase");
      const [phrase, setPhrase] = useState("");

      const handleChange = (event) => {
            setPhrase(event.target.value);
      };

      <Container>
            <h1>Add Phrase</h1>
            <FormControl fullWidth>
                  <InputLabel id="addPhraseLabel">Choose Phrase</InputLabel>
                  <Select
                  labelId="addPhraseLabel"
                  value={phrase}
                  label="Phrase"
                  onChange={handleChange}
                  >
                        <MenuItem value={"family"}>Family</MenuItem>
                        <MenuItem value={"friends"}>Friends</MenuItem>
                        <MenuItem value={"personalized"}>Personalizado</MenuItem>
                  </Select>
            </FormControl>
      </Container>
}

export default AddPhrase;
